# prepare shapes
# shore_line = buffer(lake.exterior, -0.0005).exterior  # exterior hull
shore_line = lake.exterior  # exterior hull
if not is_ccw(shore_line):  # needs to be counter-clockwise
    shore_line = shore_line.reverse()

holes: list[tuple[float, float]] = []  # keeps holes
